import "./styles.css";
import { ReactComponent as Logo } from "./logogalinha.svg";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";

function Navbar() {

  const [id, setId] = useState(0)
    useEffect(() => {
    const getId: any = localStorage.getItem('user');
    if(getId) {
      const {id} = JSON.parse(getId)
      setId(id)
    }
  },[])

  const logout = () => localStorage.setItem('user', '')

  return (
    <nav className="main-navbar">
      <Link to="/" className="logo-text">
        <Logo />
        DelyFood
      </Link>

    {
      id ? (
        <Link to="/Login" className="entrar"  onClick={logout}>
        <b>Sair</b>
      </Link>
      ) :
      (<Link to="/orders" className="entrar">
      <b>Entrar</b>
    </Link>)
    }



    </nav>
  );
}

export default Navbar;
